const Salary = (props) => {
    const income = props.income;
    const totalIncome = income.reduce((totalIncome,user) => totalIncome + user.yearlyIncome,0);
    const formatNumber = (num) => Number(num.toFixed(0));
    

    
    return (
        <div>
            <h3>Total Friends: {totalIncome.length}</h3>
    <h5>Total Yearly Income: {totalIncome}</h5>
        </div>
    );
};

export default Salary;
